UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'IYK' THEN 1.728 WHEN 'IGE' THEN 1.098 WHEN 'JHEM' THEN 1.429 WHEN 'QTR' THEN 0.29600000000000004 WHEN 'DUST' THEN 1.724 WHEN 'IWF' THEN 1.774 WHEN 'MNA' THEN 1.4500000000000002 WHEN 'KNO' THEN 2.124 WHEN 'MUSQ' THEN 0.255 WHEN 'SGDJ' THEN 5.127000000000001 WHEN 'CNEQ' THEN 0.041 WHEN 'TNA' THEN 0.46199999999999997 WHEN 'LKOR' THEN 0.7929999999999999 WHEN 'EWT' THEN 16.563 WHEN 'TPOR' THEN 0.388 WHEN 'OZEM' THEN 0.053 WHEN 'JADE' THEN 0.69 WHEN 'ICSH' THEN 0.764 WHEN 'MEXX' THEN 0.566 WHEN 'GCOW' THEN 1.056
    END,
    updatedat = NOW()
    WHERE symbol IN ('IYK', 'IGE', 'JHEM', 'QTR', 'DUST', 'IWF', 'MNA', 'KNO', 'MUSQ', 'SGDJ', 'CNEQ', 'TNA', 'LKOR', 'EWT', 'TPOR', 'OZEM', 'JADE', 'ICSH', 'MEXX', 'GCOW');